--Create Database
create database My_Fancy_Store
go
use My_Fancy_Store
go

--Create Tables
create table Customer (
   id int identity (1,1) primary key,
   first_name nvarchar(50) not null,
   last_name nvarchar(50) not null,
   city nvarchar(50) null,
   country nvarchar(50) null,
   phone_number nvarchar(20) null
)
go

create table Supplier (
   id int identity (1,1) primary key,
   company_name nvarchar(50) not null,
   contact_name nvarchar(50) null,
   contact_title nvarchar(50) null,
   city nvarchar(50) null,
   country nvarchar(50) null,
   phone_number nvarchar(20) null,
)
go

create table Product (
   id  int identity (1,1) primary key ,
   product_name nvarchar(50) not null,
   supplier_id int not null,
   unit_price decimal(12,2) null default 0,
   stock int not null,
   is_discontinued bit not null default 0,
   constraint FK_PRODUCT_REFERENCE_SUPPLIER foreign key (supplier_id) references Supplier (id)
)
go

create table Orders (
   id int identity(1,1) primary key ,
   order_date datetime not null,
   order_number nvarchar(10) null,
   customer_id int not null,
   total_amount decimal(12,2)null default 0,
   constraint FK_ORDER_REFERENCE_CUSTOMER foreign key (customer_id) references Customer (id)
)
go

create table Order_Item (
   id int identity (1,1) primary key ,
   order_id int not null,
   product_id int not null,
   unit_price decimal(12,2) not null default 0,
   quantity int not null default 1,
   constraint FK_ORDERITEM_REFERENCE_ORDER foreign key (order_id) references Orders (id),
   constraint FK_ORDERITEM_REFERENCE_PRODUCT foreign key (product_id) references Product (id)
)
go

